import { Painel } from "../components/followersContainer/styles";
import { Container } from "../components/userAccount/styled";
import { context } from "../context";

const followers = (props) => {
    const ctx = useContext(context);
    return (
        <Container>
            <FollowersContainer name={ctx.userData?.name}></FollowersContainer>
        </Container>
    );
};

export default followers;
